import React from "react";
import menu from "../../src/Utils/images/menu.png";

import "bootstrap/dist/css/bootstrap.min.css";
import { Card, Accordion, useAccordionToggle } from "react-bootstrap";
import { Navbar } from "react-bootstrap";

function Navi() {
  function CustomToggle({ eventKey }) {
    const decoratedOnClick = useAccordionToggle(eventKey, () =>
      console.log("totally custom!")
    );

    return (
      <button
        type="button"
        style={{ backgroundImage: { menu } }}
        onClick={decoratedOnClick}
      >
        {" "}
        <img
          alt=""
          src={menu}
          width="46"
          height="46"
          className="d-inline-block align-top"
        />
      </button>
    );
  }

  return (
    <Navbar bg="light">
    <Navbar.Brand as="button">
        <img
          alt=""
          src={menu}
          width="46"
          height="46"
          className="d-inline-block align-top"
        />
        {"  "}
    </Navbar.Brand>
    <Navbar.Brand>Learn More</Navbar.Brand>  <Accordion>
       <Card>
         <Card.Header>
           <CustomToggle eventKey="0"></CustomToggle>
          </Card.Header>
          <Accordion.Collapse eventKey="0">
            <Card.Body>abt and such</Card.Body>
          </Accordion.Collapse>
         </Card>
       </Accordion>
  </Navbar>
    // <Navbar>
    //   <Accordion>
    //     <Card>
    //       <Card.Header>
    //         <CustomToggle eventKey="0"></CustomToggle>
    //       </Card.Header>
    //       <Accordion.Collapse eventKey="0">
    //         <Card.Body>abt and such</Card.Body>
    //       </Accordion.Collapse>
    //     </Card>
    //   </Accordion>
    // </Navbar>
  );
}

export default Navi;
